# Encoding: Unicode (UTF-8)
#


DROP TABLE IF EXISTS `tblBook`;
DROP TABLE IF EXISTS `tblBookOwn`;
DROP TABLE IF EXISTS `tblFocus`;
DROP TABLE IF EXISTS `tblForSale`;
DROP TABLE IF EXISTS `tblParent`;
DROP TABLE IF EXISTS `tblProfile`;
DROP TABLE IF EXISTS `tblQtn`;
DROP TABLE IF EXISTS `tblQtnDone`;
DROP TABLE IF EXISTS `tblQtnGrp`;
DROP TABLE IF EXISTS `tblSale`;
DROP TABLE IF EXISTS `tblSchool`;
DROP TABLE IF EXISTS `tblSession`;
DROP TABLE IF EXISTS `tblTest`;
DROP TABLE IF EXISTS `tblTestDone`;
DROP TABLE IF EXISTS `tblTopic`;
DROP TABLE IF EXISTS `tblUser`;


CREATE TABLE `tblBook` (
  `BookId` int(11) NOT NULL AUTO_INCREMENT,
  `Title` varchar(64) DEFAULT NULL,
  `Author` varchar(100) DEFAULT NULL,
  `Publisher` varchar(64) DEFAULT NULL,
  `LevelId` tinyint(4) DEFAULT NULL,
  `SubjectId` int(11) NOT NULL,
  `Cover` varchar(128) DEFAULT NULL,
  `Price` double DEFAULT NULL,
  `Synopsis` varchar(1024) DEFAULT NULL,
  PRIMARY KEY (`BookId`)
) ENGINE=MyISAM AUTO_INCREMENT=9325 DEFAULT CHARSET=latin1;


CREATE TABLE `tblBookOwn` (
  `UserId` int(11) unsigned NOT NULL,
  `BookId` int(11) unsigned NOT NULL,
  `Done` int(11) NOT NULL,
  `Total` int(11) NOT NULL
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


CREATE TABLE `tblFocus` (
  `FocusId` int(11) NOT NULL AUTO_INCREMENT,
  `UserId` int(11) NOT NULL,
  `TopicId` int(11) NOT NULL DEFAULT '0',
  `DifficultyId` int(11) DEFAULT NULL,
  PRIMARY KEY (`FocusId`)
) ENGINE=MyISAM AUTO_INCREMENT=404 DEFAULT CHARSET=latin1 DATA DIRECTORY='./oap/' INDEX DIRECTORY='./oap/';


CREATE TABLE `tblForSale` (
  `Id` int(10) unsigned NOT NULL,
  `Type` varchar(16) NOT NULL,
  `LevelId` int(10) unsigned NOT NULL,
  `SubjectId` int(10) unsigned NOT NULL,
  `Desc` varchar(64) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


CREATE TABLE `tblParent` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `ChildId` int(11) NOT NULL,
  `FirstName` varchar(64) DEFAULT NULL,
  `LastName` varchar(32) DEFAULT NULL,
  `Email` varchar(64) DEFAULT NULL,
  `Relationship` varchar(32) DEFAULT NULL,
  `Address` varchar(256) DEFAULT NULL,
  PRIMARY KEY (`Id`)
) ENGINE=MyISAM AUTO_INCREMENT=23 DEFAULT CHARSET=latin1;


CREATE TABLE `tblProfile` (
  `UserId` int(11) NOT NULL,
  `SubjectId` int(11) NOT NULL,
  `LevelId` int(11) NOT NULL,
  `StartDate` timestamp NULL DEFAULT NULL,
  `EndDate` timestamp NULL DEFAULT NULL,
  KEY `UserId` (`UserId`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


CREATE TABLE `tblQtn` (
  `QtnId` int(11) NOT NULL AUTO_INCREMENT,
  `Path` varchar(128) NOT NULL,
  `LevelId` int(11) NOT NULL,
  `SubjectId` int(11) NOT NULL,
  `DifficultyId` int(11) NOT NULL,
  `TopicId` int(11) NOT NULL,
  `Type` varchar(8) NOT NULL,
  `Pool` tinyint(4) NOT NULL DEFAULT '0',
  PRIMARY KEY (`QtnId`),
  KEY `Index` (`LevelId`,`SubjectId`,`TopicId`,`Type`,`Pool`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=55766 DEFAULT CHARSET=latin1;


CREATE TABLE `tblQtnDone` (
  `Id` int(11) NOT NULL,
  `QtnId` int(11) NOT NULL,
  `Correct` tinyint(4) NOT NULL,
  `Favorite` tinyint(4) NOT NULL DEFAULT '0'
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


CREATE TABLE `tblQtnGrp` (
  `TestId` int(11) unsigned NOT NULL,
  `QtnId` int(11) unsigned NOT NULL,
  `Order` int(11) unsigned NOT NULL,
  `Tag` varchar(8) DEFAULT NULL,
  `Header` varchar(64) DEFAULT NULL,
  KEY `TestId` (`TestId`),
  KEY `QtnId` (`QtnId`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


CREATE TABLE `tblSale` (
  `Id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `TransactId` varchar(32) DEFAULT NULL,
  `HelperId` int(10) NOT NULL DEFAULT '0',
  `BuyerId` int(10) DEFAULT NULL,
  `ItemId` int(10) NOT NULL DEFAULT '0',
  `Type` int(10) NOT NULL DEFAULT '0',
  `Status` tinyint(4) NOT NULL DEFAULT '0',
  `Receipt` varchar(48) DEFAULT NULL,
  `ReceiptAmt` float unsigned DEFAULT '0',
  `Timestamp` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB AUTO_INCREMENT=110 DEFAULT CHARSET=latin1;


CREATE TABLE `tblSchool` (
  `SchoolId` int(11) NOT NULL AUTO_INCREMENT,
  `School` varchar(64) NOT NULL,
  PRIMARY KEY (`SchoolId`)
) ENGINE=MyISAM AUTO_INCREMENT=303531 DEFAULT CHARSET=latin1;


CREATE TABLE `tblSession` (
  `Id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `UpdateN` tinyint(4) DEFAULT '0',
  `SessionKey` varchar(32) DEFAULT NULL,
  `IdUser` int(11) unsigned NOT NULL,
  `Role` tinyint(11) DEFAULT '0',
  `DateAccess` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `Password` varchar(128) DEFAULT NULL,
  PRIMARY KEY (`Id`)
) ENGINE=MyISAM AUTO_INCREMENT=370 DEFAULT CHARSET=latin1;


CREATE TABLE `tblTest` (
  `TestId` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `BookId` int(11) DEFAULT NULL,
  `Title` varchar(64) DEFAULT NULL,
  `Unit` int(11) DEFAULT NULL,
  `Type` varchar(8) NOT NULL,
  `SubjectId` int(11) NOT NULL,
  `LevelId` int(11) NOT NULL,
  `RefTestId` int(11) DEFAULT '0',
  PRIMARY KEY (`TestId`,`Type`)
) ENGINE=MyISAM AUTO_INCREMENT=3013 DEFAULT CHARSET=latin1;


CREATE TABLE `tblTestDone` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `TestId` int(11) NOT NULL,
  `UserId` int(11) NOT NULL,
  `Correct` int(11) DEFAULT '0',
  `Total` int(11) DEFAULT '0',
  `Start` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `End` timestamp NULL DEFAULT NULL,
  `Raw` varchar(8192) NOT NULL,
  `Paused` tinyint(4) DEFAULT '0',
  `High` tinyint(4) NOT NULL DEFAULT '0',
  `LastCorrect` tinyint(4) DEFAULT NULL,
  PRIMARY KEY (`Id`),
  KEY `Index` (`TestId`,`UserId`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=304 DEFAULT CHARSET=latin1;


CREATE TABLE `tblTopic` (
  `TopicId` int(11) NOT NULL AUTO_INCREMENT,
  `SubjectId` int(11) NOT NULL,
  `Topic` varchar(64) NOT NULL,
  PRIMARY KEY (`TopicId`)
) ENGINE=MyISAM AUTO_INCREMENT=1155 DEFAULT CHARSET=latin1;


CREATE TABLE `tblUser` (
  `Id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `Username` varchar(32) NOT NULL,
  `Password` varchar(128) NOT NULL,
  `FirstName` varchar(64) NOT NULL,
  `LastName` varchar(32) NOT NULL,
  `Gender` char(1) NOT NULL,
  `Email` varchar(64) DEFAULT NULL,
  `SchoolId` int(11) NOT NULL,
  `LevelId` tinyint(4) NOT NULL,
  `SignUp` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `NewsNPromo` bit(1) DEFAULT NULL,
  `Role` int(11) DEFAULT '1',
  `ProfilePic` varchar(24) DEFAULT NULL,
  PRIMARY KEY (`Id`),
  UNIQUE KEY `login_id` (`Username`)
) ENGINE=MyISAM AUTO_INCREMENT=36 DEFAULT CHARSET=latin1;




