INSERT INTO `tblBook` (`BookId`, `Title`, `Author`, `Publisher`, `LevelId`, `SubjectId`, `Cover`, `Price`, `Synopsis`) VALUES (9295, 'Discover Maths Topical Practice 1', 'Lim Yi Chia', 'Panpac Education', 1, 1, '../res/PMA_DiscoverMaths/Cover/P1.jpg', 9.99, 'Discover Maths Topical Practice is a series of primary school Mathematics Revision books written in line with the requirements of the latest Ministry of Education syllabus for Primary Mathematics.  Each topic in the book contains Multiple Choice Questions, Short Questions and Word Problems where appropriate to challenge the learners.  The answer key provides answers to all the questions and worked solutions to all the word problems.  Discover Maths Topical practice series provides pupils with additional practice exercises beyond the textbooks.');
