INSERT INTO `tblBook` (`BookId`, `Title`, `Author`, `Publisher`, `LevelId`, `SubjectId`, `Cover`, `Price`, `Synopsis`) VALUES (9324, 'Grammar Practice 6', 'Tay Eng Hiang', 'Marshall Cavendish Education', 6, 3, '../res/PEL_GrammarPractice/Cover/P6.jpg', 9.99, 'Grammar Practice (2nd Edition) is designed to help pupils gain mastery of English grammar. The \'Teaching Points\' section at the beginning of each chapter helps pupils focus on the essential learning points of that chapter. Illustrations also provide reinforcement for pupils to consolidate their understanding. The exercises are graded by difficulty level to help pupils progress systematically, and to test their mastery of the topic.  This book works effectively as a self-study tool, where learners are guided in their learning and are provided with ample practice and exercise. The materials will help pupils greatly in sharpening their grammar skills and increasing their fluency in the language.');
